import * as React from "react";
import Moment from 'react-moment';
import AutoScale from 'react-auto-scale';
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
// Style
import './HomePage.styl'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faAnchor,
    faSmile,
    faChevronDown,
    faFilePowerpoint,
    faCircle,
    faSearch,
    faUserSecret,
    faEllipsisV,
    faCog,
    faUser,
    faPaperPlane,
    faHeart,
    faCheck,
    faHourglassHalf,
    faSkullCrossbones,
    faShip,
    faDraftingCompass,
    faArrowRight,
    faFlagCheckered,
    faBullhorn,
    faHighlighter,
    faLock,
    faLockOpen,
    faChevronRight,
    faToggleOff,
    faToggleOn,
    faPlus,
    faVrCardboard,
    faMarker
} from '@fortawesome/free-solid-svg-icons'
// Comps
import UserCompanies from "../../../component/UserCompanies/UserCompanies";
import CompanyDecks from "../../../component/CompanyDecks/CompanyDecks";
import SlideFeed from "../../../component/SlideFeed/SlideFeed";
import SlideSettings from "../../../component/SlideSettings/SlideSettings";

// GQL
const DECKS_BY_COMPANY = gql`
  query getDecksByCompany($CompanyId: ID!, $PopulateInput:PopulateInput!) {
    getDecksByCompany(CompanyId:$CompanyId, PopulateInput:$PopulateInput) {
      _id
      name
      url
    }
  }
`;

type SlideProps = {
  _id: string,
  slug: string,
  created: Date,
  _templateId: string,
  _deck: string,
  page: Page 
}
  type Page = {
    inactive: Boolean,
    class: String,
    overlay: Boolean
  }



//
// Function
//

const HomePage: React.FunctionComponent<SlideProps> = (props:any) => {
  // Set States
  const [getUserCookie, setUserCookie] = React.useState(JSON.parse(window.localStorage.getItem("user")));
  const [activeCompanyId, setActiveCompanyId] = React.useState(null);
  const [activeDeckId, setActiveDeckId] = React.useState(null);
  const [activeSlideId, setActiveSlideId] = React.useState(null);
  // Set Panel States
  const [getActiveLeftPanel, setActiveLeftPanel] = React.useState({ active:false, type:'' });
  const [getActiveRightPanel, setActiveRightPanel] = React.useState({ active:false, type:'' });
  // Set Slide
  const [getSlide, setSlide] = React.useState({
    _id:"121ddsafrwwrt",
    name:"",
    slug:"sluggish",
    ratio:"standard",
    blocks:[
      {
        content:"Undeniable ideas",
        type:"text",
        animationIn:{},
        animateOut:{},
        css:{
          "width":"",
          "fontSize":"32px",
          "fontFamily":"Arial, Helvetica, sans-serif",
          "fontWeight":"bold",
          "textAlign":"left",
          "position":"absolute",
          "top":"50%",
          "left":"50%",
          "transform":"translate(-50%,-50%)",
          "padding":"20px",
          "borderRadius":"20px",
          "color":"white",
          "backgroundColor":"pink"
        }
      }
    ],
    background:{
      css:{
        "backgroundColor":"orange",
        "backgroundImage":"",
        "backgroundSize":"cover",
        "backgroundPosition":"center center"
      },
      header:{
        css:{},
        animationIn:{},
        animateOut:{},
      },
      footer:{
        css:{},
        animationIn:{},
        animateOut:{},
      }
    },
    created:"",
    visibility:true,
    deleted:false,
    _template:"1232131243",
    _company:"1213dswewew",
    _deck:"1213dswewew",
    _user:{
      avatar:"",
      name:"Lee Marshall"
    },
  })

  //
  // Use Effect
  //

  React.useEffect(() => {
    // Set Active Company ID
    setActiveCompanyId("5ddd3993dae01149faf416ff");    
  },[activeCompanyId, setActiveCompanyId]);


  //
  // Toggle Left Panel
  //

  const toggleLeftPanel = async (type) => {
    const panelCopy = {...getActiveLeftPanel};
    if(getActiveLeftPanel.active) {
      if(getActiveLeftPanel.type !== type) {
        setActiveLeftPanel({active:false, type:panelCopy.type});
        setTimeout(
            function() {
              panelCopy.type = type;
              panelCopy.active = true;
              setActiveLeftPanel(panelCopy);
            }
            .bind(this),
            500
          )
      } else {
        setActiveLeftPanel({active:false, type:panelCopy.type});
        setTimeout(
          function() {
            panelCopy.type = '';
            panelCopy.active = false;
            setActiveLeftPanel(panelCopy);
          }
          .bind(this),
          500
        )
      }
    } else {
      setActiveLeftPanel({active:true, type:type});
    }
  }

  //
  // Toggle Right Panel
  //

  const toggleRightPanel = async (type) => {
    // Reset
    if(type === 'reset') {
      setActiveRightPanel({ ...getActiveRightPanel, ['active']:false });
      return false;
    } 
    // Toggle
    if(getActiveRightPanel.active) {
      if(getActiveRightPanel.type !== type) {
        setActiveRightPanel({ ...getActiveRightPanel, active:false, type:getActiveRightPanel.type});
        setTimeout(
            function() {
              setActiveRightPanel( { ...getActiveRightPanel, active:true });
            }
            .bind(this),
            500
          )
      } else {
        setActiveRightPanel({ ...getActiveRightPanel, active:false, type:getActiveRightPanel.type});
        setTimeout(
          function() {
            setActiveRightPanel( { ...getActiveRightPanel, active:false, type:'' });
          }
          .bind(this),
          500
        )
      }
    } else {
      setActiveRightPanel({ ...getActiveRightPanel, active:true, type:type});
    }
  }

  // Return
  return (
    <>

      {/** Header */}
      <div className="home-header">
        <div className="header-app-logo" onClick={() => props.toggleMenu(props.page)}>
          <FontAwesomeIcon icon={faAnchor}/>
        </div>
        <div className="header-container">
          <div className={ getActiveLeftPanel.active && getActiveLeftPanel.type === 'company-decks' ? 'container-button container-button-active':'container-button'} onClick={(event) => toggleLeftPanel('company-decks')}>
            <div className="button-icon">
              { getActiveLeftPanel.type !== 'company-decks' && <FontAwesomeIcon icon={faToggleOff}/> }
              { getActiveLeftPanel.type === 'company-decks' && <FontAwesomeIcon icon={faToggleOn}/> }
            </div> 
            <div className="button-deck-value">Marketing Presentation</div>
          </div>
          <div className="container-divider">
            <FontAwesomeIcon icon={faChevronRight}/>
          </div>
          <div className={ getActiveLeftPanel.active && getActiveLeftPanel.type === 'user-companies' ? 'container-button container-button-active':'container-button'}  style={{'display':'nones'}} onClick={(event) => toggleLeftPanel('user-companies')}>
            <div className="button-icon">
              { getActiveLeftPanel.type !== 'user-companies' && <FontAwesomeIcon icon={faToggleOff}/> }
              { getActiveLeftPanel.type === 'user-companies' && <FontAwesomeIcon icon={faToggleOn}/> }
            </div>  
            <div className="button-slide-value">One</div>
          </div>
          <div className="container-add-button">
            <FontAwesomeIcon icon={faPlus}/>
          </div>
          <div className="clear-float"></div>
        </div>
        {/** Avatar */}
        <div className="header-avatar">L<div className="avatar-bubble"></div></div>
      </div>

      {/** Left Panel */}
      <div className={ getActiveLeftPanel.active ? 'home-left-panel home-left-panel-active':'home-left-panel' }>
        {/** Show/Hide */}
        { getActiveLeftPanel.type === 'company-decks' && <CompanyDecks></CompanyDecks> }
        { getActiveLeftPanel.type === 'user-companies' && <UserCompanies></UserCompanies> }
        { getActiveLeftPanel.type === 'user-companies' && <UserCompanies></UserCompanies> }
      </div>

      {/** Right Panel */}
      <div className={ getActiveRightPanel.active ? 'home-right-panel home-right-panel-active':'home-right-panel' }>
        {/** Show/Hide */}
        { getActiveRightPanel.type === 'slide-settings' && <SlideSettings handler={toggleRightPanel} slide={getSlide} /> }
      </div>

      {/** Slide */}
      <div className={ getActiveLeftPanel.active ? 'home-container home-container-inactive-right':'home-container' && getActiveRightPanel.active ? 'home-container home-container-inactive-left':'home-container' }>
        <div className="container-overlay"></div>
        {/** Feed */}  
        <div className="container-slide-tasks">
          <div className="scroll-slide-tasks">
            {/** Show/Hide */}
            <SlideFeed userCookie={getUserCookie}></SlideFeed>
          </div>
        </div>
        {/** Slide Preview START */}
        <div className="container-slide">
          <div className="slide-container">
            <div className="container-header">
              <div className="header-left">
                <div className="left-slide-name">01. <b>Undeniable Ideas</b></div>
                <div className="left-slide-text">Created by <b>Lee Marshall</b> <span className="text-visibility"> <div className="visibility-icon"><FontAwesomeIcon icon={faCheck}/></div> Visible</span></div>
              </div>
              <div className="header-right" >
              <div className="right-button" onClick={(event) => toggleRightPanel('slide-settings')}>
                  <FontAwesomeIcon icon={faVrCardboard}/>
                  <div className="button-label">Preview</div>
                </div>

                <div className="right-button right-test" style={{display:'nones'}} onClick={(event) => toggleRightPanel('slide-settings')}>
                  <FontAwesomeIcon icon={faCog}/>
                  <div className="button-label">Settings</div>
                </div>
              </div>
              <div className="clear-float"></div>
            </div>
            <div className="container-preview-outer"  onClick={(event) => toggleRightPanel('slide-settings')}>
              <AutoScale maxWidth={900} maxHeight={600} maxScale={3}>
                <div className="outer-inner" style={getSlide['background']['css']}>
                  {/** Header */}
                  {/** Content */}
                  {getSlide && 
                    <>
                      {getSlide.blocks.map((value, index) => {
                        return( 
                          <div style={value['css']} key={index}>
                            {value['content']} 
                          </div>
                        )
                      })}
                    </>
                  } 
                  {/** Footer */}
                </div>
              </AutoScale>
            </div>
          </div>
        </div>
        {/** Slide Preview END */}
      </div>



    </>
  );
};

export default HomePage
